import logo from "./logo.svg";
import "./App.css";
import useAxios from "axios-hooks";
import Button from "@mui/material/Button";

function App() {
  const [{ data, loading, error }, refetch] = useAxios(
    "http://localhost:8080/team"
  );

  console.log(data);

  const createTeamCard = (teammate) => {
    return (
      <div>
      <img src="https://cdn.pixabay.com/photo/2017/10/24/07/12/hacker-2883630_1280.jpg" alt="teammate-img" />
        <h2>{teammate.name}</h2>
        <h2>{teammate.email}</h2>
        <h2>{teammate.phone}</h2>
      </div>
    );
  };

  return (
    <div className="App">
      <button>Text</button>
      <Button variant="contained">Text</Button>
      {data && data.map((teammate) => createTeamCard(teammate))}
    </div>
  );
}

export default App;
